```ts
Build a basic chat bot.
const messages = [
     {
         role: "system",
         content: "You are a helpful assistant."
     },
];

while(true) {
     const userInput = await os.showInput();
     if (!userInput) {
         break;
     }
     messages.push({
         role: "user",
         content: userInput
     });

     const response = await ai.chat(messages);
     messages.push(response);
     os.toast(response.content);
}

os.toast("Goodbye!");
```

